export default {
  name: 'index',
  filters: {
    typeFilter(type) {
      const typeName = {
        0: '企业',
        1: '开发',
        2: '安全'
      }
      return typeName[type]
    }
  },
  created() {
    this.getAll()
  },
  data() {
    return {
      listLoading: true,
      list: [],
      pageSize: 10,
      total: 0,
      currentPage: 1,
      userDialogVisible: false,
      user: {}
    }
  },
  methods: {
    getAll() {
      this.listLoading = true
      this.$http.get('/user/all', {
        page: this.currentPage - 1,
        size: this.pageSize
      }).then(response => {
        this.list = response.content
        this.total = response.totalElements
        this.listLoading = false
      })
    },
    coderHandleClick(row) {
      this.user = { ...row }
      this.userDialogVisible = true
    },
    misreportHandleClick(row) {
      this.$http.delete(`/user/${row.id}`).then(v => {
        this.$message({
          type: 'success',
          message: '删除成功!'
        })
        this.getAll()
      }).catch(v => {
        this.$message({
          type: 'success',
          message: '删除成功!'
        })
        this.getAll()
      })
    },
    updateSubmit() {
      this.userDialogVisible = false
      this.$http.post('/user', {
        ...this.user
      }).then(v => {
        this.$message({
          type: 'success',
          message: '修改成功!'
        })
        this.getAll()
      })
    }
  }
}
